import React, { useState } from "react"
import PropTypes from 'prop-types';

import {
    Modal,
} from "reactstrap"
import { translationHelpers } from "../../../helpers";
import PreviewHistorical from "./PreviewHistorical";


const ModalPreviewHistorical = (props) => {
    const [t] = translationHelpers('translation');


    return (
        <Modal
            size="xl"
            isOpen={props.isOpen}
            toggle={props.toggle}
            centered={true}>
            <div className="modal-header">
                <h5 className="modal-title mt-0">{t(props.title)}</h5>
                <button
                    type="button"
                    onClick={props.toggle}
                    className="close"
                    data-dismiss="modal"
                    aria-label="Close">
                    <span aria-hidden="true">&times;</span>
                </button>
            </div>
            <div className="modal-body">
                <PreviewHistorical title={props.title} transactId={props.transactId} instanceId={props.instanceId} />
            </div>
        </Modal>
    );
};

ModalPreviewHistorical.propTypes = {
    isOpen: PropTypes.bool,
    toggle: PropTypes.func,
    onAttach: PropTypes.func
};

export default ModalPreviewHistorical;
